-- class
function damage(value, elem)
	dmg={
		value=value,
		elem=elem or 0
	}
end

function entity(x,y,w,h)
	ety = {
		x=x,
		y=y,
		w=w,
		h=h
		--collide = true
	}
	function ety:move(dx,dy)
		self.x=self.x+dx
		if((not mapCollisionFree(self))or(not entityCollisionFree(self)))then
			self.x=self.x-dx
		end
		self.y=self.y+dy
		if((not mapCollisionFree(self))or(not entityCollisionFree(self)))then
			self.y=self.y-dy
		end
	end

	return ety
end
