function slime(x,y)
	-- todo: init slime with mob()
	local s = mob(x,y,8,8,15)
	s.ms = 0.5
	function s:startAttack()
		self.state=0
	end

	function s:update()
		local dx=0
		local dy=0
		local tx=player.x+player.w//2-self.w//2
		local ty=player.y+player.h//2-self.h//2
		if(self.x<tx)then 
			dx=1
		elseif(self.x>tx)then
			dx=-1
		end
		if(self.y<ty)then 
			dy=1
		elseif(self.y>ty)then
			dy=-1
		end
		-- if(dx~=0 and dy~=0)then
		-- 	dx=dx*0.5
		-- 	dy=dy*0.5
		-- end
		self:move(dx*self.ms,dy*self.ms*0.5)--self:move(dx*self.ms,dy*self.ms)
		-- trace("slime update")
		-- todo: Alert Range
		-- todo: slime:update()
	end
	
	function s:draw()
		-- todo: slime:draw()
		spr(480+t//20%2 * 1,self.x,self.y,14,1,0,0,1,1)
	end
	return s
end

